import React from 'react';

export default function Quotes() {
    // The initial state quoteAuthor being set to an Object of quotes from Authors with Key/Value pairs
    const quoteAuthor = {
        JoshuaCrawford: "Hello, thank you for visiting my random quote generator. Click the 'New-Quote' button to start!",
        LaoTzu: "The journey of a thousand miles begins with one step.",
        FriedrichNietzsche: "That which does not kill us makes us stronger.",
        JohnLennon: "Life is what happens when you’re busy making other plans.",
        JoeKennedy: "When the going gets tough, the tough get going.",
        MahatmaGandhi: "You must be the change you wish to see in the world."
    }

    return (
        <div>
        // Iterating through quoteAuthor for Author
            {Object.keys(quoteAuthor).map((key, index) => {
                return (
                    <div key={index}>
                        <h3 id="new-quote">
                            {key}: {quoteAuthor[key]}
                        </h3>
                    </div>
                );
            })};
        // Iterating through quoteAuthor for Quote
            {Object.keys(quoteAuthor).map((val, index) => {
                return (
                    <div key={index}>
                        <h3 id="new-quote">
                            {key}: {quoteAuthor[key]}
                        </h3>
                    </div>
                );
            })};
        </div>
    );
}
